                     <td width="99%"><div align="justify">Our Lady of Mt. Carmel Parish was established in 1927 to provide spiritual support for its members. In the Father and the Holy Spirit, the Eucharistic Presence of the risen Lord empowers our Parish Community to proclaim the Gospel and, thereby, to recognize and to accept its mission to pursue love, peace, and justice. <br />
                         <br />
                       La parroquia de Nuestra Sra. Del Monte Carmelo fue establecida en 1927 para proporcionar apoyo spiritual para sus miembros. En el Padre y el Espiritu Santo, la Presencia Eucaristica del Senor Resucitado da poder a nuestra comunidad para proclamar el Evangelio y asi reconocer y aceptar su mision de amor, paz y justicia.</div></td>
